import Foundation

/**
 所有 DNA 由一系列缩写为 A，C，G 和 T 的核苷酸组成，例如：“ACGAATTCCG”。在研究 DNA 时，识别 DNA 中的重复序列有时会对研究非常有帮助。
 
 编写一个函数来查找 DNA 分子中所有出现超多一次的10个字母长的序列（子串）。
 
 示例:
 ````
 输入: s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"
 
 输出: ["AAAAACCCCC", "CCCCCAAAAA"]
 ````
 */
class Solution187: SolutionDelegate {
    
    // BIT
    func soluctionOld(s: String) -> [String] {
        guard s.count > 10 else { return [] }
        
        let a: UInt32 = 0
        let c: UInt32 = 1
        let g: UInt32 = 2
        let t: UInt32 = 3
        
        let block = { (char: Character) -> UInt32 in
            switch char {
            case Character("A"):
                return a
            case Character("C"):
                return c
            case Character("T"):
                return t
            default:
                return g
            }
        }
        
        var scan: UInt32 = 0
        
        var set = Set<UInt32>()
        var result = Array<String>()
        var index = s.startIndex
        for i in 0..<10 {
            print(i)
            scan = scan | block(s[index])
            scan = scan << 2
            index = s.index(s.startIndex, offsetBy: i + 1)
        }
        set.insert(scan)
        
        for i in 10..<(s.count) {
            let zero: UInt32 = 0b00111111111111111111
            scan = scan & zero
            scan = scan << 2
            scan = scan | block(s[index])
            index = s.index(s.startIndex, offsetBy: i + 1)
            
            if let _ = set.index(of: scan) {
                let start = s.index(index, offsetBy: -10)
                result.append(String(s[start..<index]))
            } else {
                set.insert(scan)
            }
        }
        
        return result
    }
    
    
    //
    func soluction(s: String) -> [String] {
        print(s.count)
        guard s.count > 10 else { return [] }
        var dict = Dictionary<String, Int>()
        
        var start = s.startIndex
        var end = s.index(start, offsetBy: 9)
        while end != s.endIndex {
            let substr = String(s[start...end])
            if let value = dict[substr] {
                dict[substr] = 1 + value
            } else {
                dict[substr] = 1
            }
            
            start = s.index(start, offsetBy: 1)
            end = s.index(end, offsetBy: 1)
        }
        
        return dict.filter({ (key, value) -> Bool in
            return value > 1
        }).map({ (key, value) -> String in
            return key
        })
    }
    
    func runSolution() {
        print(soluction(s: s))
    }
    
